INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `slug`, `created_at`, `updated_at`) VALUES
(1, 'কিভাবে বই কিনতে পারব ?', 'বইয়ের বিস্তারিত অংশে যান। বইটি কিনুন বোতামে ক্লিক করে আপনি বইটি কিনতে পারবেন।  কার্ট আইকন ক্লিক করে আপনি এটি কার্টে যুক্ত করতে পারবেন। অ্যাপের উপরের ডান দিকের কোণায় চেকআউট অংশ থেকে আপনি একবারে আপনার কার্টে যুক্ত সব বই কিনতে পারবেন।', 1, 'GjPVk1714293214', '2024-04-28 12:33:34', '2024-04-28 12:33:34'),
(2, 'আমি আ্যপে বই,লেখক, প্রকাশক কিভাবে খঁজে পাবো ?', 'অ্যাপের শীর্ষে একটি সার্চ আইকন রয়েছে।  আপনি যা সন্ধান/খুঁজে বের করতে চান সেখানে লিখুন।', 1, 'Eluyv1714293250', '2024-04-28 12:34:10', '2024-04-28 12:34:10'),
(3, 'আমার কেনা বই আমি কোথায় খুঁজে পাব?', 'লাইব্রেরিতে গেলেই পেয়ে যাবেন সেখানে ইবুক ও অডিওবুক জন্য আলাদা ভাবে দেওয়া আছে।', 1, 'Vs3AA1714293273', '2024-04-28 12:34:33', '2024-04-28 12:34:33'),
(4, 'আমার অর্ডার হিস্টোরি কিভাবে দেখব?', 'আপনার প্রোফাইলে অর্ডার হিস্টোরি  অংশে যান।', 1, 'LMXen1714293294', '2024-04-28 12:34:54', '2024-04-28 12:34:54'),
(5, 'বই পড়ার সময় আমি কীভাবে থিম এবং ফ্রন্ট সাইজ পরিবর্তন করতে পারব।', 'পড়ার সময় স্কিনের নীচের মেনুটি দেখুন এবং সেখান থেকে  থিম সেট করতে পারবেন। ফ্রন্ট সাইজ পরিবর্তন করতে পারবেন।', 1, 'kixT71714293347', '2024-04-28 12:35:47', '2024-04-28 12:35:47'),
(6, 'বই কিনছি তারপরও আবার কিনতে বলে', 'এ রকম সমস্যা দেখা দিলে আপনার একাউন্ট লগআউট করে আবার লগইন করবেন তাহলে ঠিক হয়ে যাবে যেভাবে করবেন আপনি নিচের দিকে প্রোফাইল লেখা দেখতে পাবেন সেখানে ক্লিক করবেন তারপর সেটিংস লেখা দেখতে পাবেন সেখানে ক্লিক করবেন তারপর লগআউট লেখা দেখবেন সেখানে ক্লিক করবেন তারপর আপনার একাউন্ট ফোন নাম্বার, পার্সওয়াড দিয়ে আবার লগইন করবেন তাহলে আপনার সমস্যা সমাধান হয়ে যাবে', 1, '6JmCX1715072609', '2024-05-07 13:03:29', '2024-05-07 16:42:19');
