(1, 1, NULL, 73, 1, NULL, 'অপরিচিতা', NULL, 'productImages/KqQps1714195642.webp', NULL, NULL, '<p>দীর্ঘ দিন ফেসবুকে প্রেমের পরে আজকে প্রথমবার দেখা পরতে যাবে রিফা। তাই সকাল সকাল ঘুম থেকে উঠে রান্না করতে যায়।রান্নাঘরে সাহেলা ছিলো</p>\r\n\r\n<p>রিফা: (সবজি হাতে নিয়ে) মা আজকে একটু বেরুতে হবে আমার&nbsp;</p>\r\n\r\n<p>সাহেলা: ( রেগে) কোন মহাকাজে যাবেন আপনি? আজকে বাড়িতে অনেক কাজ আছে। তুই বেরুলে এসব কে করবে?</p>\r\n\r\n<p>রিফা: মা কাল করবো সব</p>\r\n\r\n<p>সাহেলা: কাল না আজকেই করতে হবে। কোথাও যাওয়া চলবে না তোর।&nbsp;</p>\r\n\r\n<p>রিফা: মা খুব দরকার।&nbsp;</p>', NULL, NULL, 10, 10, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অপরিচিতা-1719217872', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-26 21:20:44', '2024-06-24 12:31:12'),
(2, 1, NULL, 73, 1, NULL, 'অন্যরকম তুমি', NULL, 'productImages/knGFe1714197158.webp', NULL, NULL, '<p>বড় বোনের প্রেমিককে নিজের বর হিসেবে দেখে চমকে ওঠে ছোঁয়া। তাকে বিয়ে করতে হবে? কিন্তু এমনটা তো কথা ছিলো না। এই লোককে কি করে বিয়ে করবে সে? <br />\r\nখুব ভালো করেই চেনে তাকে। দুজনের মেন্টালিটি আলাদা। সংসার করবে কিভাবে?  <br />\r\nকিন্তু বাবার অসহায় মুখের দিকে তাকিয়ে ছোঁয়া কথা বলতে পারে না। চিৎকার করে বলতে পারে না \"বাবা আমি তাকে বিয়ে করবো না। প্লিজ আমাকে বিয়ে দিও না\"<br />\r\n </p>', NULL, NULL, 30, 30, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অন্যরকম-তুমি-1718687922', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-27 09:52:38', '2024-08-16 07:20:26'),
(3, 1, NULL, 75, 1, NULL, 'প্রেমে পড়া বারণ', NULL, 'productImages/sm0Ks1714199098.webp', NULL, NULL, '<p>\"আমি এই লোককে কিছুতেই বিয়ে করবো না আব্বু!!\"<br />\r\nকথাটা শেষ হওয়ার সাথে সাথে নবনীতার গালে থাপ্পড় মারলেন আফজাল সাহেব। <br />\r\nনবনী কাঁদতে কাঁদতে হেঁচকি তুলে কাঁদছে। <br />\r\nআফজাল সাহেবঃ তোমার সাহস দেখে আমি অবাক নয় হয়ে পাড়ছি না!!  এতো কিছুর পরেও তুমি মুখ খুলে কথা বলছো..? তোমার লজ্জা করছে না..!??</p>', NULL, NULL, 10, 10, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রেমে-পড়া-বারণ-1719308646', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-27 10:24:58', '2024-12-20 00:53:12'),
(4, 1, NULL, 75, 1, NULL, 'তোমাকে চাই', NULL, 'productImages/6wdi11714200433.webp', NULL, NULL, '<p>হঠাৎ হঠাৎ আসা আপনি...<br />\r\nকেমন আছেন? আশা করি ভালোই আছেন। আমার মতো  মানুষের থেকে দূরে সরে গিয়ে, আমাকে কাঁদিয়ে, পাগল বানিয়ে আপনি নিশ্চয়ই ভালো আছেন? তাই নয় কি? <br />\r\nআচ্ছা, প্রিয়? আপনি চলে যান কেন? যদি যাওয়ারই হয়, তবে হুটহাট কেন আসেন স্বপ্নে ? ভালো আছি না আপনাকে  ছাড়া? তাহলে কেন এসে নিজের উপস্থিতির জানান দিয়ে যান? কেন বোঝান, দুনিয়াতে ভালোবাসা  নামেরও কিছু আছে। যা অন্য মানুষের ভাগ্যে আছে, আর আমার ভাগ্যে নেই। <br />\r\nআপনি কেন অন্যের কাছে যান? আবার কেন আমার স্বপ্নে আসেন? আপনাকে ছুঁয়েও হারিয়ে ফেলার ব্যথাটা, আপনি টের পান না!!<br />\r\nও আমার মনের ভেতর থেকে দুঃখরূপে বেরিয়ে ভালোবাসার পুরুষ , আপনি কি শুনতে পাচ্ছেন? শুনতে পাচ্ছেন না আমার আহাজারি? যদি আমার হয়ে চিরকাল থাকতে না পারেন, তবে কেন বারো গাঙে মুখ ডুবিয়ে আবারও আমার কাছেই আসেন?<br />\r\nআমি তো আপনাকে পেলেই সব ভুলে যাই। এই যে রেগে আছি, অভিমানী শব্দ লিখছি। তুমি এলেই ভুলে যাই সব ব্যথা, পেয়ে যাই একরাশ সুখ। </p>', NULL, NULL, 25, 25, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'তোমাকে-চাই-1718687939', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-27 10:47:13', '2024-08-16 07:19:45'),
(5, 3, NULL, 72, 1, NULL, 'রূপার আংটি', NULL, 'productImages/e3gt91737449383.webp', NULL, NULL, '<p>পায়েলের মুখোমুখি বসে থাকতে বেশ অস্বস্তি লাগছে। সুন্দরী মেয়েদের সামনে এভাবে বসে থাকা যায় না। আশেপাশের লোকজন অদ্ভুত দৃষ্টিতে ওদের তাকাচ্ছে। <br />\r\nপায়েলের চোখ-মুখ শান্ত, কোন প্রকার অস্বস্তির ছাপ নেই। স্বাভাবিক ভঙ্গিতে চায়ের কাপে চুমুক দিচ্ছে। মেয়েটার মুখ দেখে মনে হচ্ছে চায়ের কাপে চুমুক দেওয়াটাই এই মুহুর্তে সবচেয়ে জরুরি। এর চেয়ে গুরুত্বপূর্ণ কোন কাজ তার কাছে নেই। <br />\r\nনিরব আগ বাড়িয়ে কোন প্রশ্ন করল না। বিরক্তি নিয়ে চারপাশে তাকাতে লাগলো। বসে থাকতে ইচ্ছে করছে না। সকালের খিদেটা চাগাড় দিয়ে উঠেছে।</p>', NULL, NULL, 30, 25, 0, 10, 1, NULL, NULL, 'বাংলা', NULL, 'রূপার-আংটি-1719331016', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-27 11:20:15', '2025-01-21 18:49:43'),
(6, 1, NULL, 74, 1, NULL, 'তোমার আমার গল্প', NULL, 'productImages/nBpdB1714203515.webp', NULL, NULL, '<p>&quot; মাশিয়াত, এই মাশিয়াত, আর কত ঘুমাবি? বেলা এগারোটা বাজে অথচ তোর ঘুম থেকে উঠার নামই নেই। সারারাত জেগে কি করিস? পড়াশোনার বেলায় তো অষ্টরম্ভা। এখনই যদি না উঠিস, তবে তোর শরীরে পানি ঢালব বলে দিলাম। &quot; রেহানা সিদ্দিকী মেয়েকে ডাকতেই থাকলেন। কিন্তু তার মেয়ের ঘুম থেকে ওঠার কোন লক্ষণই দেখা গেলনা।&nbsp;</p>', NULL, NULL, 10, 10, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'তোমার-আমার-গল্প-1719331050', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-04-27 11:38:35', '2024-06-25 19:57:30'),
(7, 2, NULL, 73, 1, NULL, 'অপরিচিতা', NULL, 'productImages/pJh451714287294.webp', NULL, NULL, '<p>দীর্ঘ দিন ফেসবুকে প্রেমের পরে আজকে প্রথমবার দেখা পরতে যাবে রিফা। তাই সকাল সকাল ঘুম থেকে উঠে রান্না করতে যায়।রান্নাঘরে সাহেলা ছিলো</p>\r\n\r\n<p>রিফা: (সবজি হাতে নিয়ে) মা আজকে একটু বেরুতে হবে আমার&nbsp;</p>\r\n\r\n<p>সাহেলা: ( রেগে) কোন মহাকাজে যাবেন আপনি? আজকে বাড়িতে অনেক কাজ আছে। তুই বেরুলে এসব কে করবে?</p>\r\n\r\n<p>রিফা: মা কাল করবো সব</p>\r\n\r\n<p>সাহেলা: কাল না আজকেই করতে হবে। কোথাও যাওয়া চলবে না তোর।&nbsp;</p>\r\n\r\n<p>রিফা: মা খুব দরকার।&nbsp;</p>', NULL, NULL, 30, 12, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অপরিচিতা-1721925712', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2024-04-28 10:54:54', '2024-07-25 20:41:52'),
(8, 1, NULL, 74, 1, NULL, 'যেখানে দিগন্ত হারায়', NULL, 'productImages/lEYq01714631067.webp', NULL, NULL, '<p>ক্যাম্পাস ভর্তি মানুষের সামনে দশাসই থা&#39;প্প&#39;ড় খেয়ে স্তব্ধ হয়ে সামনের মানুষটির দিকে তাকিয়ে আছে মাশিয়াত। আজ অব্দি যে মাশিয়াতের শরীরে কেউ ফুলের টোকা দিতে পারেনি, সেই মেয়েকে কিনা একজন অজানা-অচেনা একজন থাপ্পড় দিয়ে দিব্যি দাঁড়িয়ে আছে! আঁড়চোখে ক্যাম্পাসের সর্বত্র অবলোকনের ব্যর্থ চেষ্টা করছে সে। আশেপাশের কিছু অংশ ছাড়া বাকি সবকিছুই ওর চোখের আড়ালে। কিন্তু যতটুকুই ও অবলোকন করতে পেরেছে তাতেই রা&#39;গে ওর শিরা-উপশিরায় র&#39;ক্ত চলাচলের গতি বেড়ে গেছে। কয়েকজনকে মুখ টিপে হাসতে দেখে কপালের শিরার দপদপানি ক্রমান্বয়েই উর্ধগতি হচ্ছে। আরেকবার সেই অচেনা আগন্তুকের দিকে র&#39;ক্তচক্ষুতে তাকালো। কিন্তু সে ভাবলেশহীন মুখে তাকিয়ে আছে মাশিয়ার দিকেই। তার পেছনে জুবুথুবু হয়ে &nbsp;দাঁড়িয়ে আছে তিনজন তিনজন মেয়ে। যাদেরকে কিছুক্ষণ আগেই মাশিয়াত ও তার গ্যাং মিলে র্যাগ দিচ্ছিল। তিনজনকে জড়োসড়ো দাঁড়িয়ে থাকতে দেখে চোখ পাকিয়ে তাকায় সে। আর সেই মুহুর্তেই আগন্তুক মুখ খুলল।&nbsp;</p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'যেখানে-দিগন্ত-হারায়-1715748644', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-05-01 10:30:03', '2024-05-15 08:50:44'),
(9, 1, NULL, 482, 1, NULL, 'অবাধ্য শৃঙ্খচীল', NULL, 'productImages/LBTs31714625193.webp', NULL, NULL, '<p>বাসর রাত নিয়ে সব মেয়ের মনে থাকে যেমন ভয় তেমন ভাবেই থাকে অগনিত স্বপ্ন। আমার মনেও দুইটা বাস করচ্ছিলো তার সাথে ছিলো উত্তেজনা। কারন আমি আমার স্বামিকে এই নিয়ে দ্বিতীয় বার দেখবো আমাদের কথাও হবে আজ প্রথম। </p>\r\n\r\n<p>আরুমিতার ভাবনার মাঝেই দরজা খুলার আওয়াজ কানে আসে। আরুমিতা চোখ তুলে তাকাতেই চোখ পড়ে তার স্বামি আরিয়ান ধ্রুবের দিকে।তিনি পেশাই একজন কন্ঠশিল্পি অনেক নাম ডাক তার।অরুমিতা নিজের স্বামির কাছে এসে তার পা ধরে সালাম করতে নিলেই ধ্রুব এক ঝটকাই তালে দূরে সরিয়ে দেয়।<br />\r\n </p>', NULL, NULL, 30, 30, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অবাধ্য-শৃঙ্খচীল-1718687977', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-05-02 08:46:33', '2024-08-16 07:18:45'),
(10, 2, NULL, 75, 1, NULL, 'প্রেমে পড়া বারণ', NULL, 'productImages/G0F6f1715410640.webp', NULL, NULL, '<p>&quot;আমি এই লোককে কিছুতেই বিয়ে করবো না আব্বু!!&quot;<br />\r\nকথাটা শেষ হওয়ার সাথে সাথে নবনীতার গালে থাপ্পড় মারলেন আফজাল সাহেব।&nbsp;<br />\r\nনবনী কাঁদতে কাঁদতে হেঁচকি তুলে কাঁদছে।&nbsp;<br />\r\nআফজাল সাহেবঃ তোমার সাহস দেখে আমি অবাক নয় হয়ে পাড়ছি না!! &nbsp;এতো কিছুর পরেও তুমি মুখ খুলে কথা বলছো..? তোমার লজ্জা করছে না..!??</p>', NULL, NULL, 30, 12, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রেমে-পড়া-বারণ-1721925681', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2024-05-11 10:57:20', '2024-07-25 20:41:21'),
(11, 3, NULL, 72, 1, NULL, 'চিলেকোঠা', NULL, 'productImages/IUmv81715501272.webp', NULL, NULL, '<p>দুলাভাই মারা যাওয়ার সাতদিন পর আপা এসে বাপের বাড়ি উঠলো। আপাকে দেখে মা মুখ কালো করে ফেললেন। অস্বস্তি নিয়ে বললেন, \" এখন থেকে এখানেই থাকবি? সবকিছু গুছিয়ে নিয়ে চলে এসেছিস নাকি? ও বাড়িতে আর যাবি না?\" দুলাভাইয়ের সাথে আপার সম্পর্ক কোনো কালেই ভালো ছিল না। দুলাভাই খুব রসিক মানুষ ছিলেন। আমোদপ্রিয়। রাস্তাঘাটে মহিলা দেখলে আগ বাড়িয়ে কথা বলতেন। কথাগুলো অবশ্য খুব সাধারণ। যাকে খুশি বলা চলে। হরেক রকমের মানুষের সাথে দুলাভাইয়ের বন্ধুত্ব ছিল। অন্যদিকে আপা তার সম্পূর্ণ বিপরীত। গম্ভীর স্বভাবের, প্রয়োজনের বেশি একটা কথাও বলে না। আত্মীয় স্বজন এলে চুপচাপ থাকে। পরপুরুষের সামনে যায় না। এসব কারণে আপার শশুরবাড়ির লোকজন তাকে খুব একটা পছন্দ করে না।</p>', NULL, NULL, 40, 32, 0, 10, 1, NULL, NULL, 'বাংলা', NULL, 'চিলেকোঠা-1721925754', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-05-12 12:07:52', '2025-02-18 23:26:38'),
(12, 1, NULL, 1253, 1, NULL, 'আমার এক আকাশ ভালোবাসা', NULL, 'productImages/IGVWB1715675834.webp', NULL, NULL, '<p>ঠাস করে সপাটে একটা থাপ্পড় খেয়ে শ্রাবণী নিজেকে সামলাতে না পেরে মাটিতে লুটিয়ে পড়লো। বাড়ি ভর্তি আত্মীয়-স্বজন গিজগিজ করছে। সবার সামনে মায়ের কাছে এমন তিরস্কার পেয়ে ফুফিয়ে কেঁদে উঠলো মেয়েটা। আড় পাড়ের প্রতিবেশী আর গ্রামের মানুষ দিয়ে গোটা বাড়ি ভর্তি হয়ে গেলো কয়েক মুহূর্তের মধ্যে। মেয়েটাকে এভাবে মার খেয়ে পড়ে থাকতে দেখে ও কারোর মনে এতটুকু দয়া মায়া কাজ করলো না মেয়েটার প্রতি। প্রত্যেকে দাঁড়িয়ে দাঁড়িয়ে তামাশা দেখছে। প্রত্যেকটা দৃশ্য ভীষণ আগ্রহের সাথে গলধঃকরণ করে চলেছে তারা।পাশে অপরাধীর মতো দাড়িয়ে থাকা যুবক টা তাকে তুলতে গেলে শ্রাবণী হাত উচুঁ করে মানা করে দিলো। হঠাৎ শ্রাবণী তার জিভে নোনতা তরলের স্বাদ পেলো। বুঝতে পারল দাঁতের সাথে লেগে মুখের ভেতরে কেটে গেছে। থাপ্পড়ের তীব্রতা এতটাই বেশি ছিলো যে কেটে গিয়েও মুখের ভিতর দাঁত জিহ্ববা সব ভরে উঠল রক্তে। মুখ ভর্তি রক্ত মাখা থু থু ফেলল মাটিতে। তারপর রক্ত লাল অশ্রুসিক্ত নয়নে মায়ের দিকে তাকিয়ে অস্ফুট স্বরে বলে উঠলো,</p>\r\n\r\n<p>&#39; মা বিশ্বাস কর আমি এমন কোন কাজ করিনি যাতে আমার পরিবারের মান সম্মান নিয়ে টানাটানি পরে। আমার মৃত বাবার মাথা হেট হয়। আমার জেঠুর মান-সম্মানে দাগ পড়ে যায়। বিশ্বাস করো মা।&#39;</p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'আমার-এক-আকাশ-ভালোবাসা-1717411891', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-05-14 12:37:14', '2024-06-03 14:51:31'),
(13, 1, NULL, 1787, 1, NULL, 'এ হৃদয়ে তুমি এসেছিলে', NULL, 'productImages/mICW81716131881.webp', NULL, NULL, '<p>গতকাল মেহনূরের ভার্সিটির ইংলিশ ডিপার্টমেন্টের প্রফেসর আবরার সাদাফের সঙ্গে তার বাগদান সম্পন্ন হয়। বিষয়টা একদম গোপন রাখতে চেয়েছিল সবাই কিন্তু আজ ভার্সিটিতে এসে কথাটা একদম বাতাসের তোড়ে ছড়িয়ে যায়। কালকের বাগদানের কথাটি মেহনূর তখনই জেনেছিল। অথচ এ কথা আবরার সাদাফ আগে থেকেই জানে। অনেক কিছু খোলসা না করেই আজ নিত্যদিনের মতো ভার্সিটি এসেছে। কিন্তু যেই থেকে এসেছে এক এক করে মেয়েরা এসে শুভেচ্ছা জানাচ্ছে। এমনকি সিনিয়র কিছু আপুরাও। আবার কিছু কিছু মেয়েরা তার দিকে অদ্ভুত চোখে তাকাচ্ছে। ভার্সিটির শেষ প্রান্তে মেহনূর একটি বেঞ্চের উপরে গিয়ে বসে। অপেক্ষা করে তার প্রাণের বান্ধুবী পৃথার জন্য। যে কীনা আবরার সাদাফের ছোট বোন। বেশ কয়েক মিনিট পার হতেই পৃথা আসে। বান্ধবীকে দেখা মাত্রই দৌড়ে তার কাছে চলে আসে। পৃথা মেহনূরের পাশে বসেই ব্যাগ থেকে পানির বোতল বের করে ঢকঢক করে পানি খেয়ে নেয়। আফটার অল আজ তার বান্ধবীর অনেক কথার কৈফিয়ত দিতে হবে তো। পানি খেয়ে একটু রয়েসয়ে বলল,</p>', NULL, NULL, 30, 30, 0, 10, 1, NULL, NULL, 'বাংলা', NULL, 'এ-হৃদয়ে-তুমি-এসেছিলে-1720867195', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-05-19 19:13:23', '2024-12-28 02:25:17'),
