(16, 2, NULL, 73, 1, NULL, 'অন্যরকম তুমি', NULL, 'productImages/QUelD1717064694.webp', NULL, NULL, '<p>বড় বোনের প্রেমিককে নিজের বর হিসেবে দেখে চমকে ওঠে ছোঁয়া। তাকে বিয়ে করতে হবে? কিন্তু এমনটা তো কথা ছিলো না। এই লোককে কি করে বিয়ে করবে সে? <br />\r\nখুব ভালো করেই চেনে তাকে। দুজনের মেন্টালিটি আলাদা। সংসার করবে কিভাবে?  <br />\r\nকিন্তু বাবার অসহায় মুখের দিকে তাকিয়ে ছোঁয়া কথা বলতে পারে না। চিৎকার করে বলতে পারে না \"বাবা আমি তাকে বিয়ে করবো না। প্লিজ আমাকে বিয়ে দিও না\"<br />\r\n </p>', NULL, NULL, 90, 40, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অন্যরকম-তুমি-1720330848', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2024-05-30 14:24:54', '2024-09-06 23:40:10'),
