(20, 1, NULL, 482, 1, NULL, 'ভালোবাসার পাঁচফোড়ন', NULL, 'productImages/CcUl21718461113.webp', NULL, NULL, '<p>পাত্র হিসেবে নিজের চোখের শত্রুকে মৌটেও আশা করেনি আদ্রিতা।  তার চোখের সামনে যেনো এই মহূর্তে শর্ষে ফুলের বাগান তৈরি হয়ে গেছে। মূর্তির ন্যায় সেখানেই তার পা জমে গেছে।  কখন যে বেহুশ হয়ে গেছে আদ্রিতা টের ও পায়নি। এদিকে পাত্রকে দেখে পাত্রী বেহুশ ব্যাপারটা না মানতেই লজ্জাকর বটে।  বিশেষ করে পাত্রর জন্য কারন পাত্রকে দেখেই পাত্রী জ্ঞান শূন্য হয়ে মেঝেতে পড়ে গেছে। রাগে দুঃখে মুখ কালো করে সাইডে দাঁড়িয়ে পড়ে  নীড়।   এদিকে মেয়ের এমন কান্ডে লজ্জাই নাক কাটা যায় নাহিদ খান   এবং আসমিতা পারভীনের।   আসমিতা পারভীন নিজের ছেলেকে ইশারা করতেই আদ্রিয়ান   নিজের বোনকে পাজাকোলে তুলে ঘরে নিয়ে যায়।  তাকে দেখে যে কেউ বলে দিবে সে খুব কষ্টে নিজের হাসি আটকে রেখেছে। </p>', NULL, NULL, 30, 30, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'ভালোবাসার-পাঁচফোড়ন-1720194147', '1', NULL, NULL, NULL, 1, 1, 2, 1, '2024-06-15 18:18:33', '2024-12-27 01:10:47'),
(21, 1, NULL, 3260, 1, NULL, 'সুপুরুষ', NULL, 'productImages/KkJI91719127366.webp', NULL, NULL, '<p>কৃষ্ণবর্ণের অতিকায় বিশালদেহী পুরুষ। পাহাড়ের চূড়ার মত সুউচ্চ লম্বা ও প্রশস্ত কাঁধের অধিকারী। বিশালদেহী এমন কুচকুচে কালো পুরুষের সাথেই তার বিয়ে হয়েছে। দেখতেই রুচিতে বাঁধছে তার। এ পুরুষকে স্বামী হিসেবে কিভাবে মানবে সে? আর বাকী জীবনটায় বা কিভাবে কাটাবে? এশার ভেতরের সত্তা হাহাকার করে উঠল।</p>', NULL, NULL, 10, 10, 0, 10, 1, NULL, NULL, 'বাংলা', NULL, 'সুপুরুষ-1719127441', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-06-23 11:22:46', '2025-01-13 04:12:10'),
(22, 3, NULL, 72, 1, NULL, 'চিলেকোঠা ২', NULL, 'productImages/lUcgO1720171875.webp', NULL, NULL, '<p>মানিকের পরীক্ষা ভালো হয়নি। সে মুখ গোমড়া করে নিমগাছ তলায় বসে আছে। ক’দিনের ঝামেলায় একটুও পড়াশোনা হচ্ছে না। আজ থেকে আবার নতুন করে পড়া শুরু করতে হবে। নিজের জীবনের সাথে নতুন কাউকে জড়ানোর ইচ্ছে মানুষকে কর্মঠ করে তোলে। তার ক্ষেত্রেও ব্যতিক্রম হয়নি। পদ্মাকে নিজের করে পাওয়ার ইচ্ছেটা আজ-কাল বেশ তীব্র হয়ে উঠেছে। সারাক্ষণ মেয়েটার কথা ভাবতে ইচ্ছে করে।</p>', NULL, NULL, 25, 25, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'চিলেকোঠা-২-1720325939', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-07-05 13:26:34', '2024-11-26 23:41:36'),
(23, 3, NULL, 74, 1, NULL, 'স্বপ্ন সর্বনাশীনি', NULL, 'productImages/2v2Ut1720864683.webp', NULL, NULL, '<p>\" দোস্ত আমার মালটা আসলে একটু আওয়াজ দিস। সকাল সকাল তাকে বিরক্ত করে কলিজা গরম করব। \" কলেজের ক্যাম্পাসে বসে দুই বান্ধবী আড্ডা দিচ্ছে। আড্ডার এক পর্যায়ে রাহা তার বান্ধবী ইমাকে বলল। \" ছিহ্ রাহা, এটা কোন ভাষা হইল! তুই না দিন দিন ক্ষ্যাতের মত কথা বলতে শুরু করেছিস। মাল কাকে বলছিস? সে না আমাদের টিচার? \" \" দোস্তরে, তোর কাছে সে টিচার কিন্তু আমার কাছে সে মাল বৈ কিছুই নয়। সে আমার আজন্মের ক্রাশ। তুই এখন চুপ থাক। আর দেখ আমার বাবুটা আসছে কিনা। \" রাহা চিপস মুখে দিয়ে বলল।</p>', NULL, NULL, 30, 30, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'স্বপ্ন-সর্বনাশীনি-1722095775', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-07-13 13:58:03', '2024-08-19 18:50:08'),
(24, 2, NULL, 2168, 1, NULL, 'প্রেমের কাব্য', NULL, 'productImages/fk0rF1723955520.webp', NULL, NULL, NULL, NULL, NULL, 30, 12, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রেমের-কাব্য-1723955520', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2024-08-18 12:32:00', '2024-08-31 18:58:34'),
(26, 1, NULL, 1787, 1, NULL, 'প্রিয় সুহাসিনী', NULL, 'productImages/cSeKe1724930886.webp', NULL, NULL, '<p><span style=\"font-size: 0.875rem;\">“আব্বা আমি কোনো গুন্ডা কিংবা সন্ত্রাসীকে বিয়ে করতে রাজি নই। তুমি ওনাদের এখান থেকে চলে যেতে বলো।”</span><br></p><p>পাত্রপক্ষের সামনে হুট কথাটা বলে ওঠে বেলী। আজ যে পাত্রপক্ষ তাকে দেখতে এসেছে তারা এলাকার বড় নামকরা পরিবারের বড় ছেলে। নামকরা পরিবার কারণ তাদের পরিবারের সকল সদস্য গুন্ডাদের দলে নাম লিখেছে বহু বছর আগে। আর সে পরিবার থেকে বেলীকে দেখতে এসেছে। গ্রামেই বেলীর বড় হয়ে ওঠা। আর সে ছোট থেকে সবকিছুই জানে। দেখে এসেছে। গ্রামের সব মানুষ তাদের ভয়ে থাকতো সব সময়। আর সে পরিবার থেকে বেলীকে দেখতে এসেছে বলে কিঞ্চিৎ অবাক সে। সাথে বেলীর পুরো পরিবার। বেলীর বাবা নাহিদ সাহেব ও রাজি নন। কিন্তু এমন প্রভাবশালী লোকদের সঙ্গে কথা বলতেও দু\'বার ভাবেন। বেলীর মায়ের ক্ষেত্রেও একই রকম। তবুও পরিস্থিতির কারণে চুপ থাকতে হচ্ছে তাদের। আকস্মিক মেয়ের এহেন কথায় কেঁপে ওঠেন বাবা মা। পাত্রপক্ষের দিকে তাকিয়ে দেখলেন পাত্রের বাবা মুজাহিদ সাহেব দাঁড়িয়ে পরেছেন ইতিমধ্যে। </p><div><br></div>', NULL, NULL, 45, 45, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রিয়-সুহাসিনী-1724930886', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-08-29 19:28:06', '2024-10-23 22:05:52'),
(27, 1, NULL, 72, 1, NULL, 'অনুরিমা', NULL, 'productImages/A0EB51727847750.webp', NULL, NULL, '<p>তার ঘুম ভেঙেছে খুব ভোরে। তখনও দিনের আলো ফুটতে আরম্ভ করেনি। চারদিকে আবছা অন্ধকার। থেমে থেকে পেঁচার ডাক শোনা যাচ্ছে। অনুরিমা নিঃশব্দে উঠে দাঁড়ালো। পাশেই মৃদুল ঘুমচ্ছে। গভীর ঘুম। তবুও সামান্য শব্দ কানে গেলে হুড়মুড় করে উঠে বসবে। ছোটবেলাকার অভ্যাস। ঘুম থেকে উঠে রাজ্যের বায়না শুরু করে। বায়নার শেষ হয় ঝগড়ায়। অনুরিমা নিজের মেজাজ তেঁতো করতে চাইল না। পা টিপেটিপে ঘরের বাইরে বারান্দায় এসে দাঁড়ালো। সে এই বাড়িতে নতুন এসেছে। গতকাল রাতেই এসেছে। মনজুর সাহেব এই বাড়িটা ঠিক করে দিয়েছেন। অনুরিমা তাকে কাকা ডাকে। তিনি হঠাৎই একদিন এতিমখানায় এলেন। ঝলমলে গলায় বললেন, \"অনু মা, একটা কাজের কাজ করে ফেলেছি। তোদের দুই ভাই-বোনের থাকার ব্যবস্থা করে ফেলেছি। বিশাল বড় বাড়ি। ঠিকমতো থাকবি। ভালো-মন্দ খেতে পাবি।\"<br></p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অনুরিমা-1727847750', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-10-02 13:42:30', '2025-02-22 20:44:38'),
(28, 1, NULL, 2168, 1, NULL, 'উন্মাদ প্রেমিক', NULL, 'productImages/spaeP1728821069.webp', NULL, NULL, '<p><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">ঘড়ির কাঁটায় তখন সন্ধ্যে সাতটা বেজে আট মিনিট। মাইমুনা বেগম ঘরময় পায়চারি করে চলেছেন। একটু পরেই কলিংবেল বেজে উঠলো মাইমুনা বেগম বেলন হাতে নিয়ে চলে গেলেন দরজা খুলতে। দরজা খুলতে না খুলতেই বলে উঠলেন,\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">“দস্যি ছেলে। এত রাত অব্দি বাইরে কি করো? আজ তোমায় আমি..”\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">কিছু বলতে গিয়েও থেমে যান৷ কারণ তার আন্দাজ পুরোপুরি বিফলে গেছে। দরজায় তার পুত্র নয় বরং পতি দাঁড়িয়ে। </span></p>', NULL, NULL, 20, 20, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'উন্মাদ-প্রেমিক-1728821069', '1', NULL, NULL, NULL, 1, 1, 2, 1, '2024-10-13 20:04:29', '2024-12-27 01:11:58'),
(29, 1, NULL, 1787, 1, NULL, 'পূর্ণতার চিরকুট', NULL, 'productImages/edThg1729833559.webp', NULL, NULL, '<p><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">বিয়ের রাতে প্রিয়ন্তী কে ছেড়ে তার বর কাউকে না জানিয়ে কোঁথায় চলে গিয়েছে জানে না কেউ। তবে এ নিয়ে দূর্ভোগ পোহাতে হচ্ছে প্রিয়ন্তীর। সে জানে না তার বর কোঁথায় গিয়েছে। নতুন পরিবার, নতুন মানুষ জন আবার বিয়ের পর তার বর উধাও! বেশ অস্থিরতা কাজ করছে তার মনের ভিতর। এর মধ্যে প্রিয়ন্তীর দাদী শ্বাশুড়ি বলে উঠলো,\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">“যে মেয়েকে বিয়ের দিন রাতে তার স্বামী রেখে চলে যায় সে আদোও সংসার করতে পারবে? বলেছিলাম গ্রাম থেকে ভালো দেখে একটা মেয়ে নিয়ে আসতে তা না করে ডাক্তারের মেয়ে কে ঘরে তুলেছে! এখন দেখো কি হয়।”\r\n</span><div><br></div></p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'পূর্ণতার-চিরকুট-1729833559', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-10-25 13:19:19', '2024-10-25 13:28:59'),
(30, 7, NULL, 74, 1, NULL, 'সায়াহ্নের প্রেমছন্দ', NULL, 'productImages/KgHLQ1730391722.webp', NULL, NULL, '<p>\" বড়মা, পেখম আপুকে বিয়ে করবেনা জন্য রাজ্য ভাইয়া বাড়ি থেকে পালিয়েছে। \" </p><p>দেবরের ছেলে সিনানের মুখে এহেন অলক্ষুণে কথা শুনে ধপ করে মেঝেতে বসে পরলেন রাবেয়া সুলতানা। বাড়িতে মেহমান গিজগিজ করছে। সৈয়দ শামসুল হকের নাতনীর বিয়ে উপলক্ষ্যে আশেপাশের তিন গ্রামের মানুষকে দাওয়াত দেওয়া হয়েছে। বাড়িতে দাঁড়ানোর তিল পরিমাণ জায়গা নেই। রাবেয়া সুলতানা নিজের রুমে কিছু একটা করছিলেন, ঠিক তখনই তার ছোট দেবর সৈয়দ রাকিব আহমেদ এর ছেলে সিনান এসে তাকে এই দুঃসংবাদ দেয়। রাবেয়া সুলতানা বিশ্বাস করতে পারছেননা সিনানের কথা। তবুও তিনি অতিকষ্টে সিনানকে বললেন, </p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'সায়াহ্নের-প্রেমছন্দ-1730391400', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-01 01:16:40', '2025-01-20 13:36:33'),
(31, 7, NULL, 7385, 1, NULL, 'শ্রেয়সী তোমার জন্য', NULL, 'productImages/1aj0T1730462741.webp', NULL, NULL, '<p>\"মেয়েটি তোর প্রেমের প্রস্তাবে রাজি হয়নি বলে একবারে দলবল নিয়ে পথ আগলে দাড়িয়েছিস?\"</p><p><span style=\"font-size: 0.875rem;\">শুনশান গলির ভেতর হঠাৎ ই গমগমে ভরাট কন্ঠস্বর শুনে চমকে উঠলো ছেলে গুলো।তাদের সামনে মাথা নিচু করে কাঁধে ঝুলানো ব্যাগের দুই পাশের ফিতা দুটো কে শক্ত করে খামচে ধরে ঠোঁট টিপে নীরবে অশ্রু বিসর্জন দিচ্ছে তুলার মতো ধবধবে সাদা একটি মেয়ে।</span></p><p>ছেলে গুলো দৃষ্টি তুলে সামনে  তাকায় বাইকে ঠেস দিয়ে ক্রস স্টাইলে দাঁড়ানো ছেলেটির দিকে।আপাদ মস্তক কালো পোশাক,কালো বুট জুতায় আবৃত করেছে নিজেকে।চেহারা দেখা যাচ্ছেনা।কালো হুডি, কালো জিন্স,হাতে  বাইক গ্লাভস,মাথায় কালো হেলমেট।বাইক গ্লাভস এর আঙ্গুল ঢাকা না থাকায় ধবধবে সাদা আঙ্গুল গুলো দৃষ্টিগত হচ্ছে।</p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'শ্রেয়সী-তোমার-জন্য-1730462482', '1', NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-01 21:01:22', '2025-02-21 00:09:07'),
(32, 7, NULL, 74, 1, NULL, 'রাঙা আলোর সন্ধ্যা', NULL, 'productImages/VLkCU1730607809.webp', NULL, NULL, '<p>\" মামা, কতক্ষণ এভাবে রিক্সা দাঁড় করিয়ে রাখবেন? এভাবে দাঁড়িয়ে থাকলে আমাদের প্রথম ক্লাস মিস হয়ে যাবে। এদিকে সূর্য মামাও আজ বড্ড খেপেছে। আপনাদের দুই মামার প্যারায়, আমরা দুই অবুঝ ভাগ্নি সিদ্ধ হচ্ছি। শুনেছি মামারা নাকি আদুরে হয়। কিন্তু আপনাদের দেখে সেই ধারনা পাল্টে গেছে আজকে।  \" ওড়নার কোনা দিয়ে বাতাস করার বৃথা চেষ্টা করছে আশফি। ঘামে ওর মুখ ভিজে গেছে। কপাল বেয়ে ঘামের সরু রেখা নেমে এসে ভ্রুতে মিশেছে। টিস্যু বের করে মুখ মুছল মেয়েটা। </p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'রাঙা-আলোর-সন্ধ্যা-1730607810', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-03 14:23:30', '2024-11-03 15:37:55'),
(33, 1, NULL, 482, 1, NULL, 'সেলেনোফাইল', NULL, 'productImages/Nd2Zk1730700660.webp', NULL, NULL, '<p><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">গান শেষ করার আগেই কেউ একজন এসে অরুমিতার হাত থেকে গিটার কেড়ে নিলো।  হঠাৎ এমন হওয়াই চমকে তাকাতেই থমকে গেলো অরুমিতা।  তার স্বামি তার দিকে অগ্নি দৃষ্টিতে তাকিয়ে আছে।  অরুমিতা ঢোগ গিললো।  গান গাইতে গাইতে কখন যে সন্ধ্যা হয়ে এসেছে অরুমিতা টের পাইনি।  সে জানে এই ভুলের কঠোর শাস্তি এখন সে ভোগ করতে চলেছে।  \r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">\r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">অরুমিতার কথা সত্যি হলো।  তার স্বামি তার কঠোর হাত দাড়া মুষ্টিবদ্ধ করে নিলো অরুমিতার দীঘল কালো চুল গুলো।  ব্যাথায় কুকিয়ে উঠলো অরুমিতা।  চোখ দিয়ে নির্গলিত ভাবে অশ্রু পড়তে শুরু করলো।  চুলের প্রতিটি গোড়া যেনো ব্যাথায় জর্জরিত হয়ে আছে।  </span></p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'সেলেনোফাইল-1730699915', '1', NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-04 15:58:35', '2024-12-11 23:17:00'),
(34, 1, NULL, 3260, 1, NULL, 'প্রিয় পৌষমাস', NULL, 'productImages/BmjLQ1731127191.webp', NULL, NULL, '<p>“আধো রাতে যদি ঘুম ভেঙে যায়</p><p>মনে পড়ে মোরে প্রিয়,</p><p>চাঁদ হয়ে রবো আকাশেরও গায়।”</p><p>\'অটো টিউনের জননী, নেহা কাক্করের রিপ্লেসম্যানের জব পেয়েছিস? বেচারী নেহা কাক্কর তো ভাতে মরবে। তুই এইভাবেই ওর চাকরিটা খেয়ে দিলি! তুই এত নিষ্টুর কেনো\'রে পৌষমাস? তোর মনে কি একটুও দয়ামায়া নেই।\'</p><p>বারান্দায় দাঁড়ানো বাংলাদেশ, পাকিস্তান ও ইংল্যান্ড, এই তিন\'দেশের আদলে গঠিত এক পুরুষ অবয়ব। মুখের গঠন বাংলাদেশী, অথচ শরীরের গঠন ও গায়ের রঙ পাকিস্তানী আর চুল ইংরেজদের মত কিঞ্চিৎ লালচে। তিন দেশের আদলে সুগঠিত দৃঢ় কাঁধের সুউচ্চ লম্বা পুরুষ। সৌন্দর্যে সুদর্শন, সুপুরুষ হলেও তার প্রতিটা বাক্যে বিষাক্ত তীরের মত। সব তাকে তুচ্ছতাচ্ছিল্য করার মূল অভিসন্ধি। কিন্তু সেও দমার পাত্র নয়। পাল্টা জবাব দেয়ার মত অ\'স্ত্র সবসময় তোলায় থাকে তার। দু\'জনের দূরত্ব শুধুমাত্র কয়েক গজের। দখিনা বারান্দায় দাঁড়ানো সেই পুরুষকে দেখেও না দেখার অদৃশ্য ভান করল পৌষী। তার বেসুরা গলায় উঁচুস্বরে গেয়ে উঠল,</p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রিয়-পৌষমাস-1731127191', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-09 14:39:51', '2024-11-09 14:56:32'),
(35, 1, NULL, 1787, 1, NULL, 'প্রিয় সুহাসিনী ২', NULL, 'productImages/rmehr1734966449.webp', NULL, NULL, '<p>“এই গ্রামে কখনো কোনো অবিবাহিত ছেলে মেয়ে একে অপরের দিকে চোখ তুলে তাকানোর সাহস দেখায়নি অথচ তোরা কীনা এ দু\'টো মেয়ের হাত ধরে বিরক্ত করছিস? এত বড় সাহস কে দিয়েছে তোদের?”</p><p>ছেলে চারটা অপরিচিত পুরুষালী গম্ভীর কন্ঠের কথাগুলো শুনে সামনে তাকায়। কিছুটা বিরক্তি নিয়ে তাকালেও মানুষটার দিকে চোখ পরা মাত্রই সকল বিরক্তি উবে গিয়ে তীব্র জড়তা, ভয় এসে হাজির হয় মনের মধ্যিখানে। ভয়ে পালানোর জন্য অস্থির হয়ে উঠে তারা। এরই মাঝে একজন অস্পষ্ট কন্ঠে আওড়ায়,</p><p><span style=\"font-size: 0.875rem;\">“তন্ময় ভাই?”</span></p><p>কেউ কথাটি না শুনলেও যার নাম উচ্চারণ করা হয়েছে সে ঠিকই শুনেছে। বাকিদের থেকে নজর সরিয়ে তীক্ষ্ণ দৃষ্টিতে তাকায় একটা ছেলের দিকে। মুহূর্তেই থতমত খেয়ে যায় ছেলেটা। আমতা আমতা করা শুরু করে। তন্ময় গম্ভীর স্বরে ভ্রুজোড়া উঁচিয়ে শুধায়,</p><div><br></div>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রিয়-সুহাসিনী-২-1731907596', '1', NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-18 15:26:36', '2024-12-24 01:07:29'),
(36, 1, NULL, 2168, 1, NULL, 'অশ্রুজলে বোনা বিয়ে', NULL, 'productImages/LrA4E1731908948.webp', NULL, NULL, '<p>বিয়ের আসরে বরের স্থলে নিজের চাচাতো ভাই আবরাজকে দেখে চরম পর্যায়ের অবাক হয়ে গেল নিঝুম। হতবাক হয়ে তাকিয়ে রইলো শেরওয়ানি পরিহিত আবরাজের দিকে। আবরাজও ঠিক একইভাবে অবাক চোখে তাকালো নিঝুমের দিকে। নিঝুমকে ভালো ভাবে পরখ করে যখন তাকে বধূবেশে দেখলো তখন আবরাজ চরম পর্যায়ের রেগে গেলো। নিজের মাথা থেকে বিয়ের পাগড়িটা খুলে দূরে ছিটকে ফেলে বলে,\"অসম্ভব,আমি কিছুতেই এই বিয়েটা করতে পারবো না। চাচা, তুমি তো বলেছিলে অনেক ভালো একটা মেয়ের সাথে আমার বিয়ে ঠিক করেছ, তাহলে এসবের মানে কি?\" </p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অশ্রুজলে-বোনা-বিয়ে-1731908948', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-11-18 15:49:08', '2025-01-19 01:59:23'),
(38, 1, NULL, 8080, 1, NULL, 'মিসেস ওয়ার্ল্ড', NULL, 'productImages/vz01r1732337882.webp', NULL, NULL, '<p><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">বাইরে থেকে গোলাগুলি, মারামারির শব্দ ভেসে আসছে। প্রিয়মের পুরো মাথা কালো পর্দায় আবৃত থাকায় টিমটিমে আলো ছড়ানো ঘরটাও ঘুটঘুটে অন্ধকার মনে হচ্ছে। তার হাতদুটো পিছমোড়া করে চেয়ায়ের সঙ্গে বাঁধা। ফলে ছুটোছুটি করেও লাভ বিশেষ হচ্ছে না। নিজেকে ছাড়ানোর বৃথা চেষ্টা তাও চলমান থাকল। অস্ট্রেলিয়া থেকে পড়াশোনা শেষ করে বাংলাদেশে এসেছে বাবা-মায়ের সাথে দেখা করতে, কিছু সময় কাটাতে। কিছুদিন এখানে থেকে আবার চলে যাবে অস্ট্রেলিয়ায়। ওখানেই জব করবে বলে ভেবে রেখেছে। তবে বিপত্তি ঘটে বাংলাদেশ বিমানবন্দরে পা রাখার পরই। হুট করেই কয়েকজন মিলে জোর করে তাকে গাড়িতে তুলে নেয়। তারপর এখানে নিয়ে আসে। ওর বাবার থেকে মুক্তিপণ দাবি করে পাঁচ কোটি টাকা। \r\n</span><span class=\"x1lliihq\" style=\"scrollbar-width: thin; scrollbar-color: rgba(var(--black-rgb), .2) transparent; padding: 0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \