(39, 7, NULL, 8713, 1, NULL, 'রং', NULL, 'productImages/zgnZn1733807812.webp', NULL, NULL, '<p>বান্ধবীর বিয়েতে গিয়ে দেখি বর আমার প্রেজেন্ট বয়ফ্রেন্ড। আমার বুকটা ধুক করে কেঁপে উঠলো। হৃদপিণ্ডটা থেমে গেলো।আমি বাকরুদ্ধ হয়ে দাঁড়িয়ে আছি।কাল রাতে এই মহানায়ক আমাকে বলেছে সে ট‍্যুরে যাচ্ছে। নেটওয়ার্কের সমস‍্যা থাকলে ফোন বন্ধ দেখাবে। অথচ সে সোজা বিয়ের পিড়িতে। দুই বছর পনেরো দিনের রিলেশন আমাদের। কতো খুনশুটি আর ভালোবাসার স্মৃতি আমাদের।আমার চোখে রাফি সৎ, নম্রভদ্র ছেলে। তারচেয়ে বড় কথা আমাকে নিয়ে ভিষণ সিরিয়াস সে।খুব কেয়ারিং ছেলে।অথচ ছেলেটা না জানিয়ে সোজা অন‍্য মেয়েকে বিয়ে করতে চলে এলো। অথচ আমি টু শব্দটিও জানলাম না।</p><p>বিয়েটি যেহুতু ঘরোয়া ভাবে। তাই সবাইকে ড্রয়িং রুমের পাশের রুমটিতে বসানো হয়েছে। অধীর আগ্রহ নিয়ে হবু দুলাভাইকে দেখতে গেলাম। জানালার ফাঁকে চোখ রাখতেই রাফিকে দেখলাম।  অনেকগুলো ছেলের মধ‍্যে রাফি ধবধবে সাদা পাঞ্জাবী পড়ে আছে।</p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'রং-1733807812', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-12-10 15:16:52', '2025-01-03 21:12:47'),
(40, 1, NULL, 2168, 1, NULL, 'অশ্রজলে বোনা বিয়ে ২', NULL, 'productImages/shV4i1735968370.webp', NULL, NULL, '<p>নিজের চাচাতো ভাইকে বিয়ে করার পরই নিঝুম বুঝতে পারল তার জীবন এখন আর আগের মতো স্বাধীন থাকবে না। তাকে পরাধীনতার শিকলে বাঁ ধার জন্য এই বিয়েটাই যথেষ্ট ছিল। একটু আগেই তো সে তার চাচার মুখে শুনে এলো, তার পড়াশোনা বন্ধ করানোর পরিকল্পনা চলছে৷ এসব ভেবেই নিঝুমের চোখে জল চলে আসে। নিঝুম ভেবে দেখে, তার আসলে কি দোষ ছিল? নিঝুম তো ভালো মেয়ে৷ ছোটবেলা থেকে পাড়ায় মহল্লায় সব খানেই ভালো মেয়ে বলেই তার পরিচয় ছিল৷ সবাই তাকে দেখিয়ে দিয়ে বলল, নিঝুমের মতো হওয়ার চেষ্টা কর। কিন্তু আজ সে তার পরিবারের সবার চোখে খারাপ। কি দোষ ছিল নিঝুমের? সে শুধু একটু পড়াশোনাই করতে চেয়েছিল। এর জন্যই জোরপূর্বক তার বিয়ে দেওয়া হলো তার নিজেরই চাচাতো ভাইয়ের থেকে। নিঝুম একটা দীর্ঘ শ্বাস ফেলল গোপনে। এমন সময় দরজা চাপানোর শব্দ হলো। নিঝুম পিটপিট করে চোখ তুলে তাকালো। তাকাতেই দেখতে পেল তার চাচাতো ভাই আবরাজকে! আবরাজ ধীর পায়ে এগিয়ে আসল নিঝুমের দিকে৷ নিঝুম বলল,\"ভাইয়া আপনি প্লিজ আমার কাছে আসবেন না। আমার ঠিক ভালো লাগছে না।\"</p><p>আবরাজ বলল,\"এই স্টুপিড মেয়ে, একদম চুপ থাকো। এমনিতেই তোমার জন্য আমার জীবনটা নষ্ট হয়ে গেছে। এখন আবার কি নাটক শুরু করেছ?\"</p><p>নিঝুম ক্রন্দনরত হয়ে বলে,\"আমি নাটক করছি না ভাইয়া। এই বিয়েতে তো আমারও মত ছিল না।\"</p>', NULL, NULL, 10, 10, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অশ্রজলে-বোনা-বিয়ে-২-1734531917', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-12-19 00:25:17', '2025-01-04 15:26:10'),
(41, 7, NULL, 72, 1, NULL, 'বসরাই গোলাপের ঝাড়', NULL, 'productImages/tKZAh1735020866.webp', NULL, NULL, '<p>দু\'বছরের ছেলেটা যেদিন পানিতে পড়ে মা\'রা গেল। সেদিন তার বড় ননদাই বেশ তাচ্ছিল্যের সুরে বলল, “ছোট শালা নেহাৎ ভেড়া। আমি হলে এমন মেয়ে মানুষ ঘরের চৌকাঠে রাখতাম না। এই মুহূর্তে বের করে দিতাম।”</p><p>নববী ভেজা চোখে তাকাল। তার শাশুড়ি বড় জামাইয়ের গলায় সুরে সুর মিলিয়ে বললেন, “হাবিবকে বলে আর বোঝাতে পারলাম কোথায়! সবই আমার কপাল।”</p><p>বাড়িতে লোক দাঁড়ানো জায়গা নেই। খানিকক্ষণ আগেও এখানে কেউ ছিল না। অল্প সময়ে ব্যবধানে অনেক মানুষ জড় হয়েছে। দুই বছরের নিষ্পাপ শিশু পানিতে ডুবে মা\'রা গেলে কেউই আর ঘরে আসে থাকতে পারে না। যে কখনও আসেনি, সে-ও এক পলক উঁকি দিতে আসে। নববী ঘরের কাজ করছিল। হঠাৎই খেয়াল করল - সোহেলকে আশেপাশে দেখা যাচ্ছে না। সে কয়েকবার ছেলের নাম ধরে ডাকলো। তারপরই নিজের কাজে ব্যস্ত হয়ে পড়ল। চুলায় গরুর দুধ জ্বাল করছে। এই মুহূর্তের জন্য চোখ সরালে স’র্ব’না’শ হয়ে যাবে। তাছাড়া দুপুরে খাবার সময় হয়ে এসেছে। তার শশুর মহিউদ্দিন সাহেব ঠিক একটার সময় খেতে বসেন। আ’গু’ন-গরম ভাতে এক চামচ ঘি ঢেলে খাওয়া শুরু করেন। এক মিনিট দেরি হলে তার চোটপাট সহ্য করা যায় না। জীবনের দীর্ঘ সময় তিনি এই নিয়ম পালন করে এসেছেন। শেষ বয়সে এসে কোন অবস্থায় এই নিয়মের ব্যতিক্রম করতে পারবেন না। শরিফা বেগম নিজের সংসার জীবনে স্বামী এই নিয়ম নিয়ে প্রচন্ড বিরক্তিবোধ করেছেন। এখন অবশ্য ছেলে বউ আসায় তিনিও এই নিয়ম পালনে আগ্রহ প্রকাশ করেন।</p><div><br></div>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'বসরাই-গোলাপের-ঝাড়-1735020866', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-12-24 16:14:26', '2025-01-16 00:33:46'),
(42, 1, NULL, 1939, 1, NULL, 'প্রণয়ের প্রেমআলাপ', NULL, 'productImages/wGxu41735021997.webp', NULL, NULL, '<p>পুরানো ডাইরী টা হাতে নিয়ে বদ্ধ ঘরে একের পর এক সিগারেট টানছে ইনিয়া। </p><p>এলোমেলো রুম। চার পাশে সিগারেটের খোসা। হালকা লাল আলো ঘরটার পরিবেশ আরো ভয়াবহ অবস্থা করে রেখেছে। </p><p> সুনাধন্য ব্যবসায়ী নওয়াজ আহমেদ এবং সুমনা ইসলাম এর একমাত্র মেয়ে ইনিয়া। </p><p>ছোট থেকে মা বাবার প্রিয় মেয়ে ছিলো ইনিয়া। লেখাপড়া নাচ গান আবৃত্তি সব কিছুতেই ইনিয়া সবার আগে। তবে একটা ঝড় যেনো হঠাৎ মেয়েটার জীবন একদম এলোমেলো করে দিলো। </p><p>সুমনা মেয়ের ঘরে উকি দিতেই সিগারেটের গন্ধে কেশে উঠলেন। নাকে কাপড় দিয়ে মেয়ের রুমে ঢুকলো। ইনিয়া বিছানার উপর পরে আছে মাতাল হয়ে। কোনো মতে ইনিয়াকে নিয়ে বের হলো। ইনিয়াকে অন্য রুমে রেখে কাজের লোককে ডেকে বললো,</p><p>ইনিয়া ম্যাম এর ঘর টা ক্লিন করে দাও। এবং ভালো করে ক্লিন করবে। কোথাও যেনো এসব পরে না থাকে। বাসায় গেস্ট আসবে আজ।</p><p>ওকে ম্যাম।</p>', NULL, NULL, 22, 22, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'প্রণয়ের-প্রেমআলাপ-1735021997', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-12-24 16:33:17', '2025-02-19 14:52:14'),
(43, 2, NULL, 74, 1, NULL, 'তোমার আমার গল্প', NULL, 'productImages/ZxeRr1735481226.webp', NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'তোমার-আমার-গল্প-1735481226', '1', NULL, NULL, NULL, 1, 1, 1, 1, '2024-12-30 00:07:06', '2024-12-30 00:08:22'),
(44, 1, NULL, 12996, 1, NULL, 'শেষ প্রহরে তুমি আমি', NULL, 'productImages/aGEyB1739009788.webp', NULL, NULL, '<p>বিয়ে বাড়ি থেকে পালিয়ে এসেছি নিজের প্রেমিকের জন্য কিন্তু  এখন সেই প্রেমিক আমার সামনে  বর সেজে বসে রয়েছে। </p><p> বাড়ি থেকে পালিয়ে এসে বয়ফ্রেন্ডের বাসায় আসি কিন্তু এখানে অনেক লোক আর মানুষ দেখে প্রথমে অবাক হয়। পরে মনে করেছি কোনো অনুষ্ঠান হচ্ছে হয়তো কিন্তু যখন নিজের প্রেমিককে বিয়ের আসরে কনে সাজে অন্য একটা মেয়ের পাশে বসে থাকতে দেখি তখন সব বুঝতে পারি। </p><p><span style=\"font-size: 0.875rem;\">আমার নাম মেঘ আর আমার প্রেমিক সিয়াম। দুইবছরের রিলেশন আমাদের যেই মানুষটাকে নিয়ে অনেক সপ্ন ছিলো যার পাশে বউ সেজে বসে থাকার কথা ছিলো। আজকে সে আমার চোখের সামনে অন্য কারো জন্য বসে রয়েছে। চোখে জল নিয়ে সামনে থাকা মানুষকে দেখে যাচ্ছি কি সুন্দর হেঁসে হেঁসে কথা বলছে তাহলে কি সে ভুলে একসাথে কাটানো আমাদের সুন্দর মূহুর্ত। </span></p><p>সিয়াম বউয়ের সাথে বসে বসে ছবি তুলতে থাকে হঠাৎ করে ভিড়ের মধ্যে ওর চোখ পড়ে মেঘের দিকে। মেঘকে দেখে ওর চোখ কপালে উঠে যায় আজকে মেঘের বিয়ে আর ও এখানে কি করছে। মেঘের শরীরে কনের শাড়ি মনে হয় বিয়ে থেকে পালিয়ে এসেছে কিন্তু এখন কি হবে। মেঘ যদি সবাইকে সত্যি বলে দেয় সিয়াম বলে - </p>', NULL, NULL, 19, 19, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'শেষ-প্রহরে-তুমি-আমি-1735552947', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2024-12-30 20:02:27', '2025-02-19 18:15:09'),
(45, 7, NULL, 13723, 1, NULL, 'শুভ্রতা', NULL, 'productImages/ncUCF1736872234.webp', NULL, NULL, '<p>→ হুু!...............  এক অর গানা প্লিজ মিরান। ( চারিদিকে অডিয়েন্সের কড়ো হাততালা কারান আর মিরার ডুয়েট গানের জন্য। আর কারান আর মিরার জুটিকে ফ্যানরা একসাথে নাম দিয়েছে  মিরান । আর প্রথমবারের মতো দেশ ছেড়ে বিদেশের মাটিতে মিরান জুটি এসেছে শো করতে। ভারতের মোম্বাইতে ছিলো তাদের প্রথম বাইরে শো। আর এই শোতেই এত রেসপন্স কল্পনাও করতে পারেনি মিরান। হাজার হাজার ফ্যান তাদের চারিদিকে এ যেন কারানের  স্বপ্নের সেই মুহুর্ত যা সে সারাজীবন কল্পনা করে এসেছে।)</p><p>কারান ঘুমের মধ্যে বিরবির করছে তা  দেখে মিরা ধাক্কা দেয় কারানকে। মিরার  এক  ধাক্কায় ঘুম থেকে লাফিয়ে  উঠে কারান হাড়ির মতো মুখ করে বলে,</p><p> মিরা দিলে তো আমার এত সুন্দর স্বপ্নটা ভেঙ্গে? কত সুন্দর মুহুর্ত  ছিলো তুমি জানো?</p><p>মিরা মুখ ভেংচে বলে, আগ্গে জানি, মোম্বাইতে তোমার আর আমার প্রথম শো তাও সুপারহিট! এটা শুধু স্বপ্নেই দেখা যায় বুঝছো। আমরা কোথায় আছি সেটাতো একবার ভাবো তারপর স্বপ্ন দেখো। এটা বাংলাদেশ আর তুমি স্বপ্নে থাকো মুম্বাইতে। সিরিয়াসলি! </p><p>কারান মিরার ঠোটে আঙুল চেপে ধরে বলে, চুপ। এই সকালবেলা এত সুন্দর করে সেজেগুজে আমার সামনে বসে আমারই স্বপ্নের নেগেটিভ রিভিউ দিলে কিন্তু খুব খারাপ হবে মিরা। </p><p>মিরা বলে, আচ্ছা। কি করবে শুনি? </p><p>কারান মিরাকে শক্ত করে জড়িয়ে ধরে বলে, বেশিকিছু করবো না রাতের মুডে ফিরে যাবো। </p><p>মিরা কারানের কথা বুঝতে পেরেই কারানকে ঠেলে সরিয়ে দিয়ে দরজার কাছে দাড়িয়ে বলে, তাই বুঝি? ধরতে পারলে তো? </p><p>কারান মিরাকে ডেকে বলে, মিরা কোথায় যাচ্ছো? তোমার তো এখন অফিস ছুটি।তাহলে সকাল সকাল কই যাও? তুমি  না বলেছিলে ছুটির কদিন আমাকে রেখে কোথাও যাবে না। তাহলে কেন আমাকে বারবার একা করে রেখে যাও। যাও তোমার সাথে আড়ি। </p><p>মিরা কাঁদো কাদো গলায় বলে,  জান অফিস থেকে কল দিয়েছে। কে যেন আমায় খুজছে কয়েকদিন ধরে। আমার তো ছুটি চলছে তাই জানায় নি। বাট আজকে নাকি অনেক রিকুয়েস্ট করেছে। খুব দরকার নাকি। জাস্ট কথা বলেই ফিরে আসবো। খাবার টেবিলে রেখে দিয়েছি প্লিজ খেয়ে নিও। </p><p>কারান বলে, তুমি না খুব ভালো ইমোশনাল ব্ল্যাকমেল করতে পারো। দিলে তো আমাকে গলিয়ে। জানতে আমি তোমার চোখে জল সহ্য করতে পারি না। যাও আমি কিছু মনে করবো না। তবে তাড়াতাড়ি আসবে। </p><p>মিরা বলে, টেনশন নিও না বস জাস্ট যাবো আর আসবো। </p><p>কারান বলে, ওক্কে। </p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অবেলায়-তোমার-আগমন-1736232078', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2025-01-07 16:41:18', '2025-01-15 02:36:06'),
(46, 1, NULL, 13746, 1, NULL, 'অরুণোদয়ের প্রেম', NULL, 'productImages/D5dKU1737781321.webp', NULL, NULL, '<p>পূর্ণিমার চাঁদ যেন রাতের আকাশে এক স্বর্গীয় প্রদীপ, তার কোমল রূপালি আলোয় স্নান করছে গোটা প্রকৃতি। আকাশের নীল গহ্বরে চাঁদের চারপাশে ছড়িয়ে পড়া আলো এক মোহনীয় মায়াজাল সৃষ্টি করেছে। মৃদু মৃদু সাই সাই করে বইছে হিমেল বাতাস, যেন প্রকৃতির এক নীরব সঙ্গীত।</p><p>বাতাসের প্রতিটি স্পর্শে মনে হয়, কোনো অদৃশ্য শিল্পী তার অনুভূতির রঙে রাতকে রাঙিয়ে দিচ্ছে।</p><p>প্রকৃতির এই রূপ যেন এক কবিতা, যা শুধুই অনুভবের জন্য। চাঁদ আর বাতাস মিলে রচনা করেছে এক অনবদ্য সুর, যা হৃদয়কে প্রশান্তি আর মনকে অপার্থিব আনন্দে ভরিয়ে দেয়। এ এক নিঃশব্দ সৌন্দর্য, যা দেখার নয়, উপলব্ধি করার।</p><p>আর এই রাতের কালিমায় বাতাসের তীব্রতা যেন বহুগুণ বেড়ে গেছে।বাতাস এমন ভাবে ছুটছে যেন তা</p><p>ধ্বনির পড়ণের শাড়িটা ভেদ করে তার পেটে বারংবার সুচের মত বিঁধছে!পশম গুলো দাঁড়িয়ে যাচ্ছে। কিন্তু </p><p>এরচেয়েও ভয়ানক অনুভূতি হচ্ছে নিজের উদরে তুরাবের হাতের স্পর্শে।তুরাবের ঠান্ডা হাতের নমণীয় স্পর্শ অনুভব করতেই ধ্বনি বারবার কেঁপে উঠছে।</p><p>তুরাবের গরম নিঃশ্বাস ধ্বনির ঘাড় বরাবর বারংবার পড়ছে।যা ধ্বনিকে ভেতর থেকে নাড়িয়ে দিচ্ছে। </p>', NULL, NULL, 38, 38, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'অরুণোদয়ের-প্রেম-1736259111', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2025-01-08 00:11:51', '2025-02-19 14:50:46'),
(47, 1, NULL, 12996, 1, NULL, 'হারানো সুর', NULL, 'productImages/DSNyz1739439918.webp', NULL, NULL, '<p>\"- স্বামী দুইবছর ধরে বিদেশে থাকে তোর তাহলে তুই  প্রেগনেন্সি রিপোর্ট অনুসারে তিনমাসের গর্ভবতী কি করে হলি ? </p><p>কথাটা  পাখির কানে যায় সে কান্না করতে থাকে কি হচ্ছে কোনো ঘটনা তার মাথায় ঢুকছে না। দুইদিন ধরে শরীরটা কেমন যোনো করছিলো তাই ডক্টরের কাছে গিয়ে পরীক্ষা করিয়েছে কিন্তু ডক্টর যে রিপোর্ট দিয়েছে তাতে সে তিনমাসের প্রেগন্যান্ট কি করে সম্ভব এইটা। পাখি  কান্না করতে থাকে আর বলে - </p><p>\"- বিশ্বাস করেন মা এইসব মিথ্যা কথা আমি প্রেগন্যান্ট নয় রিপোর্ট মনে হয় কোনো ভুল হয়েছে। আবার পরীক্ষা করে দেখতে হবে আসলে সত্যি ঘটনা কি \"।</p><p>তাজকিয়া বেগম চিৎকার করে উঠে দাঁড়ায় কতো বড়ো সাহস মেয়েটার একতো নিজের ছেলের বিবাহিত বউ হয়ে অন্য কারো সন্তান গর্ভে নিয়েছে। আবার মেয়েটা বড়ো বড়ো কথা বলছে সাহস কি করে হয়। তাজকিয়া বেগম বলে - </p>', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'হারানো-সুর-1739439918', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2025-02-13 19:45:18', '2025-02-23 13:02:25');
