0px; margin: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: \"SF Pro Text\", \"SF Pro Icons\", system, -apple-system, system-ui, \"system-ui\", \"Helvetica Neue\", Helvetica, Arial, \"Lucida Grande\", \"Kohinoor Devanagari\", sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; font-size: 14.2px; vertical-align: baseline; border: 0px; outline: none; display: block; color: rgb(17, 27, 33); white-space-collapse: preserve;\">নিজের শাশুড়ীর মুখে এই কথা শুনে আশালতা ঘাবড়ে গেল৷ গত কালকেই চৌধুরী বাড়ির বউ হয়ে এসেছে সে। আর আজ থেকেই তার উপর এই ধরণের শাসনের করাঘাত এসে পড়ল। আশালতা নিজেকে গুটিয়ে নিল। তার শাশুড়ী মোসলেমা বেগম বললেন,\"তোমার পরনের সব গয়নাগাটি খুলে আমার হাতে দাও। তোমায় এসব গহনায় মানাচ্ছে না। তার থেকে বড় কথা এসব তুমি সামলাতে পারবে না। যদি চুরি টুরি হয়ে যায়। এমনিতেই বুঝতে পারছি তোমার স্বভাব বেশ উড়নচণ্ডী। তাই বেশি কথা না বাড়িয়ে তোমার পড়নের সব গহনা আমার হাতে তুলে দাও দেখি।\"</span></p>', NULL, NULL, 19, 19, 0, 0, 1, NULL, NULL, 'বাংলা', NULL, 'চৌধুরী-গিন্নি-1739716496', NULL, NULL, NULL, NULL, 1, 1, 2, 1, '2025-02-17 00:34:56', '2025-02-19 14:50:12');
