(380, 21, 3332, 5, 'মেঘা আপুর এই গল্পটা পড়ে এত আবেগাপ্লুত হয়ে গেছি,রিভিউ কী দিব বুঝতে পারছি না।বরাবরের মতো মেঘা আপু আমার পছন্দের মানুষ।উনার লিখনি সম্পর্কে যত লিখবো তত কম পড়বে।সত্যিই উনার লিখনি অসাধারণ।আমি উনার সব গল্পই পড়েছি আলহামদুলিল্লাহ।সব সময়ের মত এই গল্পটাও মনছুঁয়ে গেছে।উনার উপস্থাপন,শব্দ চয়ন,লেখার ধরন এক বাক্যে অসাধারণ।স্বালিন ভাবে শব্দ ব্যাবহার করে কিভাবে গল্পে রোমাঞ্চ তুলে ধরা যায়,সেটা মেঘা আপুর গল্প পড়লে বুঝতে পারা যায়।বরাবরের মতো এই গল্পটাও হৃদয় ছুঁয়ে যাওয়ার মতো একটা গল্প।আমার ভীষণ ভীষণ ভালো লেগেছে গল্পটা।এক কথায় অসম্ভব অসম্ভব সুন্দর হয়েছে।আমার কাছে এত্তো ভালো লেগেছে, এত্তো ভালো লেগেছে বলে বুঝাতে পারবো না। আপু! আপনাকে অনেক অনেক ধন্যবাদ, আমাদের জন্য এত সুন্দর একটা গল্প লিখেছেন।আশাকরি সামনে আরও সুন্দর সুন্দর গল্প পাবো।আল্লাহ আপনাকে সুস্থ্য,সুন্দর রাখুন এবং আরও সুন্দর সুন্দর গল্প লিখার তাওফিক দান করুন। আমীন।১ম রিভিউ, ভুল ত্রুটি ক্ষমা সুন্দর দৃষ্টিতে দেখবেন।', NULL, '1719160122xnazX', 1, '2024-06-23 20:28:42', '2024-06-23 20:33:18'),
(381, 21, 3332, 5, 'মেঘা আপুর এই গল্পটা এত্তো ভালো লেগেছে কী বলবো ভাষা খুঁজে পাচ্ছি না। উনার লিখনি সম্পর্কে যত লিখবো তত কম পড়বে।বরাবরের মত উনি আমার একজন পছন্দের মানুষ। উনার প্রতিটা গল্প আমি পড়েছি আলহামদুলিল্লাহ।সবসময়ের মত এই গল্পটাও অসাধারণ ছিল। উনার উপস্থাপন, শব্দ চয়ন,লেখার ধরন এক কথায় অসম্ভব সুন্দর।গল্পে শালীন শব্দ ব্যাবহার করে কিভাবে রোমাঞ্চ তুলে ধরা যায়, তা মেঘা আপুর গল্প পড়লে বুঝা যায়। উনার এই গল্পটা আমার কাছে এত্তো ভালো লেগেছে, এত্তো ভালো লেগেছে এক কথায় অসম্ভব অসম্ভব সুন্দর হয়েছে। আপু আপনাকে অনেক অনেক ধন্যবাদ গল্পটা দেয়ার জন্য। আশাকরি সামনে আরও সুন্দর সুন্দর গল্প পাবো। আল্লাহ আপনাকে সুস্থ্য,সুন্দর এবং আরও সুন্দর সুন্দর গল্প লিখার তাওফিক দান করুন। আমীন।আশাকরি,ভুলত্রুটি ক্ষমা সুন্দর দৃষ্টিতে দেখবেন।', NULL, '1719160991mVA9r', 1, '2024-06-23 20:43:11', '2024-06-23 20:45:05'),
