(391, 21, 3355, 5, 'আলো বলে অন্ধকার তুই বড়ো কালো, অন্ধকার বলে_ ভাই তাই তুমি আলো। কথাটি সম্পূর্ণ রূপে ফুটে উঠেছে আপনার এই গল্পে। বাহ্যিক সৌন্দর্য কিছু সময়ের, কিন্তু মনের সৌন্দর্য অপার।এশা তার স্বামী নিয়াজ কে কালো বলে দূর ছাই করলেও, নিয়াজ কিন্তু কখনও তার স্ত্রী কে কষ্ট দেয়নি। এতেই তার আসল রূপ প্রকাশ পেয়েছে। লেখিকা ম্যাডাম আপনি সত্যিই খুব ভালো লেখেন। আপনার লেখার হাত মার্জিত ও বটে। গল্প তো অনেক লেখিকা লেখে, কিন্তু আপনার লেখা আমার কাছে অনেক ভালো লাগে 🥰🥰🥰 কোন প্রকার অশালীন ভাষা ছাড়াই সহজে সব গল্পকথা তুলে ধরেন। প্রতিটি গল্পে থাকে শিক্ষনীয় বিষয়। এক একটা গল্পের মাধ্যমে আমাদের একটা করে সুন্দর মেসেজ দেন, যে কি ভালো আর কি খারাপ। \"সুপুরুষ \" গল্প টা ও এর বাইরে নয়। আমাদের সবার উচিত নিজের জীবন সঙ্গী কে প্রাধান্য দেয়া। রূপের দিক থেকে জাজ না করে তার গুন খুঁজে দেখা। স্বামী/স্ত্রী যেই হোক না কেন যদি ভালবাসা আর দায়িত্ববোধ না থাকে তাহলে সৌন্দর্য ধুয়ে পানি খাবেন? লেখিকা ম্যাডাম আপনি এমন সুন্দর সুন্দর গল্প আমাদের উপহার দিতে থাকুন। এতো সুন্দর গল্প আমাদের উপহার দেয়ার জন্য ধন্যবাদ আপনাকে লেখিকা ম্যাডাম 🥰🥰🥰❤️❤️❤️', NULL, '1719324743ma9ZW', 1, '2024-06-25 18:12:23', '2024-06-25 18:39:56'),
