(503, 26, 2073, 5, 'ওয়াও খুব সুন্দর গল্পটা। এতদিন পর পড়লাম। নেক্সট তাড়াতাড়ি দিবেন প্লিজ। খুব অপেক্ষায় থাকি। আর লেখিকার হাতের লিখা অসাধারণ। গল্প বাজারের এডমিনদের উদ্দেশ্যে বলছি আমাদের কমেন্ট এপ্রুভ করবেন সবগুলো। তাহলে লেখিকা পরের পার্ট লিখার জন্য অনুপ্রেরণা পাবে। প্লিজ নেক্সট তাড়াতাড়ি দিবেন।🖤 ধন্যবাদ', NULL, '1725446213F56CD', 1, '2024-09-04 18:36:53', '2024-09-04 22:11:02'),
(506, 21, 6200, 5, 'গল্পটা পড়ে এতো পরিমাণে আবেগ আপ্লুত হয়েছি সেটা বলে বুঝাতে পারবো না। কি রিভিউ দিবো বুঝতেছি না। একটু ট্রাই করে দেখি কিছু লিখতে পারি কি না।\n\nগল্পটি অত্যন্ত স্নিগ্ধ ও হৃদয়স্পর্শী। মূল চরিত্র দুজনের মধ্যে বয়সের পার্থক্য এবং ছেলেটির গায়ের রঙ কালো হওয়া সত্ত্বেও গল্পের ভিন্নধর্মী সম্পর্কের কারণে গল্পটিকে অনন্য করে তুলেছে। শুরুতে, মেয়েটি ছেলেটির প্রতি কোনও আকর্ষণ বা গুরুত্ব দেয় না, যদিও ছেলেটির ভালোবাসা ছিল গভীর ও নিঃস্বার্থ। মেয়েটির অবজ্ঞা তাকে কষ্ট দিলেও ছেলেটি কখনও তাকে চাপিয়ে দেয়নি। বরং, সময়ের সাথে ধৈর্য ও স্নেহের মাধ্যমে, তারা দুজনেই একে অপরকে নতুনভাবে আবিষ্কার করে এবং তাদের মধ্যে মধুর সম্পর্ক গড়ে ওঠে, যা শেষ পর্যন্ত একটি মিলনের মধ্য দিয়ে পরিণতি লাভ করে। \n\nগল্পের কিছু জায়গায় যে ধরনের দৃশ্য ছিল, সেগুলো খুব সহজেই অশ্লীল বা খারাপ লাগতে পারত, কিন্তু লেখিকা অত্যন্ত মার্জিত ও সুশৃঙ্খল ভাষার ব্যবহার করে সেই দৃশ্যগুলোকে এত সুন্দরভাবে উপস্থাপন করেছেন যে, কোনও অসুবিধা বা অস্বস্তি হয়নি। লেখিকার লেখা এতটাই মনোমুগ্ধকর যে প্রতিটি বাক্য হৃদয়ে দাগ কাটে। তাঁর লেখার মাঝে কিছু একটা আছে, যা পাঠককে গভীরভাবে আকৃষ্ট করে এবং গল্পে ডুবে যেতে বাধ্য করে।\n\nগল্পটি কেবল একটি প্রেম কাহিনী নয় বরং এটি অনেক শিক্ষণীয় একটি কাহিনী। এটি শেষ পর্যন্ত একটা সুন্দর বার্তা দেয় যে, গায়ের রঙ দিয়ে মানুষকে কখনও বিচার করা যায় না। ছেলেটির গায়ের রঙ কালো হলেও, তার ভালোবাসা, চরিত্র এবং ধৈর্য তাকে অনন্য করে তুলেছে। কালো রঙ কখনোই খারাপের প্রতীক নয়। লেখিকা এই বার্তাটি অত্যন্ত সূক্ষ্মভাবে তুলে ধরেছেন, যা সমাজের জন্য অত্যন্ত গুরুত্বপূর্ণ। \n\nগল্পটি পড়ে যেমন তৃপ্তি পেয়েছি তার সাথে অনেক কিছু শিখতেও পেরেছি। লেখিকার গল্পে সব সময়ই শিক্ষণীয় একটা দিক থাকবেই থাকবে। এটা তো শুরু থেকে শেষ পর্যন্ত পুরোটাই শিক্ষা দিয়ে মুড়ানো। \n\nদোয়া করি আপনি জীবনে অনেক বড় হন আর সুখী হন। সবশেষে বলবো, আমাদেরকে এতো সুন্দর একটা গল্প উপহার দেয়ার জন্য আপনাকে অনেক অনেক ধন্যবাদ আর বুক ভরা ভালোবাসা❣️', NULL, '1725515128Q73i2', 1, '2024-09-05 13:45:28', '2024-09-05 15:19:31'),
