(765, 21, 14364, 5, 'মাত্র একদিনেই সুপুরুষ গল্পটা আমি পড়ে শেষ করে ফেললাম। এখন যে কি রিভিউ দেবো বুঝতে পারছি না, অসাধারণ একটা গল্প ছিলো।পুরো গল্পটা যেন আমার চোখের সামনে ঘটেছে এমন মনে হয়েছে।পুরোই বাস্তবভিত্তিক একটা গল্প। প্রথম প্রথম এশার উপর আমার রাগ হতো। কিন্তু পরে বুঝেছি এখানে এশার কোনো দোষ নেই।প্রতিটি মেয়েরই কিছু স্বপ্ন থাকে,এশারও ওরকম স্বপ্ন ছিল।এশা আসলে বাস্তব মেয়েদের চরিত্র।আর নিয়াজের কথা কি বলবো,জাস্ট দারুন লেগেছে আমার।প্রতিটি মেয়েদের যেমন স্বপ্ন পুরুষ থাকে নিয়াজ হয়তো সেরকম না। তবে নিয়াজ সুপুরুষ।বাস্তব জীবনে প্রতিটি মেয়েদের নিয়াজের মতো জীবন সঙ্গী দরকার।এশা যে পরবর্তীতে উপলব্ধি করতে, নিয়াজ কালপুরুষ হলেও সুপুরুষ এতেই আমি খুশি। ভালো থাকুক নিয়াজ -এশা। খুব মিস করবো ওদেরকে।মেঘা সুবাশ্রী আপুর প্রায় সবগুলো গল্পই আমি পড়েছি। তিনি খুব সুন্দর, সাবলীলভাবে, অশ্লীলতা বিহীন গল্প ফুটিয়ে তোলেন। সুপুরুষ গল্পটা ও এর ব্যতিক্রম নয়। টানা হ্যাচড়া করে বড় না করেই খুব সুন্দর ভাবে আপু গল্পটাকে লিখেছেন। আমার পড়া বেস্ট একটা গল্প ছিলো। এতো সুন্দর একটা গল্প উপহার দেওয়ার জন্য মেঘা সুবাশ্রী আপুকে অসংখ্য ধন্যবাদ 💖♥️💞💝🏵️💖 ভালোবাসা অবিরাম। এভাবেই আমাদের সুন্দর সুন্দর গল্প উপহার দিও আপু।এটা আমার প্রথম রিভিউ,তাই ভুল ত্রুটি ক্ষমা সুন্দর দৃষ্টিতে দেখবেন।', NULL, '1736869939fWcAP', 1, '2025-01-15 01:52:19', '2025-01-15 01:56:55'),
